import React from "react";
import cn from "classnames";

const ContactOneInfoItem = (props) => {
  const isLowerIcon = props.item.icon === "fa-map-marker-alt" && props.additionalClass === "lower-icon";

  return (
    <div className={cn("contact-info-item", { "lower-icon": isLowerIcon })}>
      <div className="icon">
        <span className="icon-background"></span>
        <i className={cn("fas", props.item.icon, { "lower-icon-style": isLowerIcon })}></i>
      </div>
      <div className="content">
        <p>{props.item.content}</p>
      </div>
    </div>
  );
};

export default ContactOneInfoItem;
